  const [error, setError] = useState('');
  const [data, setData] = useState([]);

useEffect(() => {
    setLoading(true);
    fetch('../../assets/data/data.json')
      .then((response) => response.json())
      .then((data) => {
        setLoading(false);
          setData(data);
          console.log(data);
      })
      .catch((e) => {
        setLoading(false);
        setError('fetch failed');
      });
}, []);

const Hero = () => {
    return (
        <div className='hero'>

        </div>
    )
}

export default Hero
